@import url(
  'http://fonts.googleapis.com/css?family=Roboto+Slab|Open+Sans:400italic',
  700,
  italic,
  400,
  700
);

$themes: (
  light: (
    backgroundColor: #fff,
    textColor: #408bbd,
    buttonTextColor: #408bbd,
    buttonTextTransform: none,
    buttonTextHoverColor: #61b0e7,
    buttonColor: #fff,
    buttonBorder: 2px solid #fff,
    buttonShadowBox: 60px -16px teal,
    font-stack: 'Roboto Slab'
  ),
  dark: (
    backgroundColor: #222,
    textColor: #ddd,
    buttonTextColor: #aaa,
    buttonTextTransform: uppercase,
    buttonTextHoverColor: #ddd,
    buttonColor: #333,
    buttonBorder: 1px solid #aaa,
    buttonShadowBox: inset 5em 1em gold,
    font-stack: 'Open Sans'
  )
);

.container {
  max-width: 70%;
  margin: auto;
  margin-top: 3rem;
}

